CREATE DEFINER=`root`@`localhost` PROCEDURE `POST_SEARCH`(
IN `_id` int,
IN `_category_id` int,
IN `_title` varchar(256),
IN `_summary` TEXT,
IN `_description` TEXT,
IN `_thumbnail` varchar(1024),
IN `_start_date` DATETIME,
IN `_end_date` DATETIME,
IN `_create_by` int,
IN `_tags` varchar(256),
IN `_limit` int,
IN `_offset` int)
BEGIN
select *
from `post`
where `is_active` = 1
AND (_id=0 OR `id` = _id)
AND (_category_id=0 OR `category_id` = _category_id)
AND (_title='' OR `title` LIKE CONCAT('%', _title, '%'))
AND (_summary='' OR `summary` LIKE CONCAT('%', _summary, '%'))
AND (_description='' OR `description` LIKE CONCAT('%', _description, '%'))
AND (_thumbnail='' OR `thumbnail` LIKE CONCAT('%', _thumbnail, '%'))
AND ((`_start_date`='0000-00-00 00:00:00' OR `create_date` >= _start_date) AND(_end_date='0000-00-00 00:00:00' OR `create_date` <= _end_date))
AND (_tags='' OR `tags` LIKE CONCAT('%', _tags, '%'))
AND (_create_by=0 OR `create_by` = _create_by)
order by `id` DESC
limit _offset, _limit;
END ;;
